// CompanyProfile.js
import React from 'react';

const CompanyProfile = () => {
  // Data perusahaan (gantilah dengan data aktual Anda)
  const companyDetails = {
    nama: 'Nama Perusahaan',
    industri: 'Industri Teknologi',
    lokasi: 'Jakarta, Indonesia',
    deskripsi:
      'Perusahaan teknologi terkemuka yang fokus pada pengembangan solusi inovatif untuk mendukung transformasi digital.',
    website: 'https://www.example.com',
    mediaSosial: {
      linkedin: 'https://www.linkedin.com/company/example',
      twitter: 'https://www.twitter.com/example',
      facebook: 'https://www.facebook.com/example',
    },
  };

  return (
    <div>
      <h1>Profil Perusahaan</h1>
      <h2>{companyDetails.nama}</h2>
      <p>Industri: {companyDetails.industri}</p>
      <p>Lokasi: {companyDetails.lokasi}</p>

      <div>
        <h3>Deskripsi Perusahaan:</h3>
        <p>{companyDetails.deskripsi}</p>
      </div>

      <div>
        <h3>Website:</h3>
        <a href={companyDetails.website} target="_blank" rel="noopener noreferrer">
          {companyDetails.website}
        </a>
      </div>

      <div>
        <h3>Media Sosial:</h3>
        <ul>
          {Object.entries(companyDetails.mediaSosial).map(([platform, link]) => (
            <li key={platform}>
              <a href={link} target="_blank" rel="noopener noreferrer">
                {platform.charAt(0).toUpperCase() + platform.slice(1)}
              </a>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default CompanyProfile;
